import React, { Component } from 'react';
import ReactDOM from 'react-dom';
 
class Lista extends Component{
    render(){
        return(
            <div className='lista'>
                <p className='lista__text'>perguntas</p>
                <button className='lista__button' >nova pergunta</button>
                <p className='lista__text2' >Ordem</p>
                <p className='lista__text2' >Editar</p>
                <p className='lista__text2' >Excluir</p>
            </div>
        );
    }
}

export default Lista;
